All functions, structs, macros, etc... use a prefix, and yeah you guessed the prefix is slac . So for example if I want to create two vectors then print the sum of the two I will have to do something like this: #include <slac/slac.h> int
main(void) { slac_vector a = slac_vector(2, 3); slac_vector b = slac_vector(4, 6); slac_vector_printl(slac_vector_add(a, b)); return 0;
} OUTPUT: [ 6, 9 ] This is done to prevent conflicts with other libraries that you might have, but if you're 100% sure that there will not be any conflicts and you dont wanna type slac_this slac_that all the time you can "remove" the prefix. All you have to do is define this macro: #define __USING_SLAC__ But remember it has to be BEFORE the include files, if you define it after then it'll not work. With the macro defined the same code from before can be written like this: #define __USING_SLAC__
#include <slac/slac.h> int
main(void) { vector a = vector(2, 3); vector b = vector(4, 6); vector_printl(vector_add(a, b)); return 0;
}
